INSERT INTO [dbo].[tblSpecOffense] VALUES (N'1', N'Inciting or provoking a fight or actually engaging another into a fight within company property or premises or outside the premises but within the vicinity of the company premises, provided such incident has relation to work', N'2', N'1', N'0')
GO

INSERT INTO [dbo].[tblSpecOffense] VALUES (N'2', N'Any act constituting a threat, intimidation or coercion against any person or in any manner interfering or obstructing any company operations or other employees from performing their work while within company property or premises, or job; any form of bullying', N'2', N'1', N'0')
GO

INSERT INTO [dbo].[tblSpecOffense] VALUES (N'3', N'Any attempt to inflict, or inflicting, or in fact having inflicted any physical injury while within company premises or job sites, or within the vicinity of the company premises where such incident has relation to work or company activities', N'2', N'1', N'0')
GO

INSERT INTO [dbo].[tblSpecOffense] VALUES (N'1', N'Theft, robbery, or appropriation for personal gain or profit to any property of the company, or a fellow employee or client or any customer of the company in company premises or on job sites', N'5', N'2', N'0')
GO

INSERT INTO [dbo].[tblSpecOffense] VALUES (N'2', N'Swindling or malversation of funds or property of the company or or a fellow employee or of a client or customer of the company', N'5', N'2', N'0')
GO

