GO

INSERT INTO [dbo].[tblSpecOffense] VALUES (N'6', N'Malicious or willful destruction, damage or misuse of company property or property of any employee including safety signages and paraphernalia, or property of client or customers of the company while within company premises or job sites', N'2', N'2', N'0')
GO

INSERT INTO [dbo].[tblSpecOffense] VALUES (N'7', N'Alteration or removal from the premises without authorization of any property of the companyt, government or of other employees', N'2', N'2', N'0')
