INSERT INTO [dbo].[tblSpecOffense] VALUES (N'1', N'Falsification or misrepresentation of personal records including non-disclosure of serious historical background such as conviction in a civil or criminal act under the law of the Philippines regardless of relevance of such conviction to the  current job position of the employee', N'5', N'3', N'0')
GO

INSERT INTO [dbo].[tblSpecOffense] VALUES (N'2', N'Failure to report immediately a personal injury occurring on company time or property.', N'6', N'3', N'0')
