GO

INSERT INTO [dbo].[tblSpecOffense] VALUES (N'4', N'Persuading, inducing, or influencing another employee to perform an act constituting a violation of these rules, regulation, or policies, or an offense in connection with the duty or function of the latter or allowing him/herself to be persuaded, induced or influenced to commit such violation or offense or depending on the nature of the offense committed.', N'2', N'3', N'0')
GO

