INSERT INTO [dbo].[tblSpecOffense] VALUES (N'7', N'Giving false testimony or unauthorized disclosure of company’s valuable information, e.g. company’s files and records, acquired by his/her office or by him/her on account of his/her position to unauthorized person', N'5', N'3', N'0')
