-- ----------------------------
-- Procedure structure for get_withpay_leave_credit
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[get_withpay_leave_credit]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[get_withpay_leave_credit]
GO

CREATE PROCEDURE [dbo].[get_withpay_leave_credit]
@command varchar(255),
@searchValue varchar(255),
@yearNow datetime2
AS
BEGIN
SELECT leaveTypeID AS NO,
leaveType AS LEAVE_DESC,
days as TOTAL_APPROVE_DAYS,
sum(totalDays) as TOTAL_USED_CREDIT,
days - sum(totalDays) as REMAINING_CREDIT 
FROM
(SELECT
dbo.tblLeaveType.leaveTypeID,
dbo.tblLeaveType.leaveType,
dbo.tblLeaveType.days,
employeeID,
ISNULL(sum(dbo.tblLeave.totalDays), 0) as totalDays
FROM
dbo.tblLeaveType
LEFT JOIN dbo.tblLeave ON dbo.tblLeaveType.leaveTypeID = dbo.tblLeave.leaveTypeID AND year(dateTo) = year(@yearnow) AND employeeID = @searchValue AND withpay = 'Yes' 
group by
dbo.tblLeaveType.leaveTypeID,
dbo.tblLeaveType.leaveType,
dbo.tblLeaveType.days,
employeeID) AS SUBT

GROUP BY
leaveTypeID,
leaveType,
days

END
GO


