GO

CREATE PROCEDURE [dbo].[get_dtr_record_summary]
@dfrom datetime2,
@dto datetime2
AS
BEGIN
 select distinct 
 CONVERT(varchar,c.dtrDate,111) as Date,
b.employeeID,
b.lastname + ', ' + b.firstname + ' ' + b.middlename AS NAME,
SUM(workedHours) as wh,
SUM(absentHours) as absent,
SUM(rhCounted) as rhc,
SUM(nwhCounted) as nwhc,
SUM(rhHoursReported) as rh,
SUM(nwhHoursReported) as nwh,
SUM(otHours) as oth,
SUM(otnHours) as otnh,
SUM(rdrHours) as rdrh,
SUM(lateUtMins) as lateut,
ISNULL(c.remarks, '') as remarks,
ISNULL(c.dtrRecordNo, '') as dtrRecordNo
from 
tblEmployeesInfo b
left join tblDTRrecord c on c.empid = b.employeeID and CONVERT(varchar,c.dtrDate,111) BETWEEN CONVERT(varchar,@dfrom,111) and CONVERT(varchar,@dto,111)
 where   ISNULL(CONVERT(varchar,c.dtrDate,111), '') <> '' 
 GROUP BY
 CONVERT(varchar,c.dtrDate,111),
 b.employeeID,b.lastname + ', ' + b.firstname + ' ' + b.middlename,
 ISNULL(c.remarks, ''),
ISNULL(c.dtrRecordNo, '')
END
GO


-- ----------------------------
-- Procedure structure for get_leave_record
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[get_leave_record]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[get_leave_record]
GO

CREATE PROCEDURE [dbo].[get_leave_record]
@command varchar(255),
@dfrom datetime2,
@dto datetime2,
@searchValue varchar(255)
AS
BEGIN
if @command = '0' begin
select employeeID,
name,
sum(Leave_Without_Pay) as Leave_Without_Pay,
sum(Leave_With_Pay) as Leave_With_Pay
from
(SELECT
dbo.tblLeave.employeeID,tblEmployeesInfo.lastname + ', ' + tblEmployeesInfo.firstname + ' ' + tblEmployeesInfo.middlename AS NAME,
case when dbo.tblLeave.withpay = 'No' then
dbo.tblLeave.totalDays 
else
0 
end as Leave_Without_Pay,
case when dbo.tblLeave.withpay = 'Yes' then
dbo.tblLeave.totalDays 
else
0 
end as Leave_With_Pay
FROM
dbo.tblLeave
inner JOIN dbo.tblLeaveType ON dbo.tblLeave.leaveTypeID = dbo.tblLeaveType.leaveTypeID
INNER JOIN dbo.tblEmployeesInfo ON dbo.tblLeave.employeeID = dbo.tblEmployeesInfo.employeeID
where 
CONVERT(varchar,dateFrom,111) BETWEEN CONVERT(varchar,@dfrom,111) and CONVERT(varchar,@dto,111)) as s
GROUP BY
employeeID,
name
end
END
GO


